import React, { useState } from 'react';
import Card from 'react-bootstrap/Card';
import Nav from 'react-bootstrap/Nav';

const SupplierInfo = () => {
  const [activeKey, setActiveKey] = useState("#first");

  const handleNavSelect = (selectedKey) => {
    setActiveKey(selectedKey);
  };

  return (
    <Card>
      <Card.Header>
        <Nav variant="tabs" defaultActiveKey="#first" onSelect={handleNavSelect}>
          <Nav.Item>
            <Nav.Link eventKey="#first">Initial info</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="#link">Advance info</Nav.Link>
          </Nav.Item>
        </Nav>
      </Card.Header>
      <Card.Body>
        {activeKey === "#first" && (
          <Card.Text>

          </Card.Text>
        )}
        {activeKey === "#link" && (
          <Card.Text>
            Text for Advance info.
          </Card.Text>
        )}
      </Card.Body>
    </Card>
  );
}

export default SupplierInfo;
